    <style>

      body {
        font-family: "PlainEn", "Arial", "Verdana";
        margin: 0;
        --page-layout-padding-xxl-x: 200px;
        --page-layout-padding-xl-x: 80px;
        --page-layout-padding-lg-x: 50px;
        --page-layout-padding-md-x: 20px;
        --page-layout-padding-sm-x: 20px;
        svg {
          max-width: 100%;
        }
        & .topNavbar {
          display: block;
          position: fixed;
          left: 0;
          right: 0;
          top: 0;
          background-color: #fff;
          border-bottom: solid 1px #d2d5d9;
          padding-top: 20px;
          padding-bottom: 20px;
          z-index: 9;
          @media (max-width: 991px) {
            padding-left: var(--page-layout-padding-sm-x) !important;
            padding-right: var(--page-layout-padding-sm-x) !important;
          }
          @media (min-width: 992px) {
            padding-left: var(--page-layout-padding-md-x) !important;
            padding-right: var(--page-layout-padding-md-x) !important;
          }
          @media (min-width: 1200px) {
            padding-left: var(--page-layout-padding-lg-x) !important;
            padding-right: var(--page-layout-padding-lg-x) !important;
          }
          @media (min-width: 1440px) {
            padding-left: var(--page-layout-padding-xl-x) !important;
            padding-right: var(--page-layout-padding-xl-x) !important;
          }
          @media (min-width: 1920px) {
            padding-left: var(--page-layout-padding-xxl-x) !important;
            padding-right: var(--page-layout-padding-xxl-x) !important;
          }
          & .topNavbarInner {
            @media (min-width: 1920px) {
              width: 1912px;
              margin: auto;
              max-width: 100%;
            }
          }
        }
        & .imageWithTextWrapper {
          display: flex;
          text-align: center;
          max-width: 100%;
          justify-content: center;
          margin: auto;
          min-height: calc(100vh - 108px);
          align-items: center;
          margin-top: 100px;
          @media (max-width: 991px) {
            padding-left: var(--page-layout-padding-sm-x) !important;
            padding-right: var(--page-layout-padding-sm-x) !important;
          }
          @media (min-width: 992px) {
            padding-left: var(--page-layout-padding-md-x) !important;
            padding-right: var(--page-layout-padding-md-x) !important;
          }
          @media (min-width: 1200px) {
            padding-left: var(--page-layout-padding-lg-x) !important;
            padding-right: var(--page-layout-padding-lg-x) !important;
          }
          @media (min-width: 1440px) {
            padding-left: var(--page-layout-padding-xl-x) !important;
            padding-right: var(--page-layout-padding-xl-x) !important;
          }
          @media (min-width: 1920px) {
            padding-left: var(--page-layout-padding-xxl-x) !important;
            padding-right: var(--page-layout-padding-xxl-x) !important;
          }
          & .imageWithText {
            display: flex;
            gap: 13px;
            flex-direction: column;
          }
          & .errorImageText {
            font-family: "PlainSemiBoldEn", "Arial Black", "Verdana Bold";
            font-size: 140px;
            line-height: 90%;
            color: #0c3957;
            margin-top: 40px;
            @media (max-width: 768px) {
              font-size: 90px;
            }
          }
          & p {
            font-size: 14px;
            font-weight: 400;
            line-height: 160%;
            color: #6c737f;
            margin: auto;
          }
        }
      }
    </style>
